    public function getSourceContext()
    {
        return new Source("{% extends '@OroUI/actions/update.html.twig' %}

{% block content_data %}
    {% if not form.vars.valid and form.vars.errors|length %}
        <div class=\"alert alert-error\" role=\"alert\">
            <div class=\"message\">
                {{ form_errors(form) }}
            </div>
        </div>
    {% endif %}
    <fieldset class=\"form form-horizontal\">
        {{ form_row(form.identifier) }}
        {{ form_row(form.name) }}
        {{ form_row(form.active) }}
        {% if form.grants is defined %}
            {% if 'hidden' in form.grants.vars.block_prefixes %}
                <div data-validation-ignore=\"true\">{{ form_row(form.grants) }}</div>
            {% else %}
                {{ form_row(form.grants, {'group_attr': {'class': 'client-grants'}}) }}
            {% endif %}
        {% endif %}
        {{ form_rest(form) }}
        <div class=\"widget-actions form-actions\">
            <button class=\"btn\" type=\"reset\">{{ 'Cancel'|trans }}</button>
            <button class=\"btn btn-primary\" type=\"submit\">{{ 'Save'|trans }}</button>
        </div>
    </fieldset>
{% endblock content_data %}
", "@OroOAuth2Server/Client/dialog/update.html.twig", "/home/gigi/Development/Cu.be/oro-phpstan-test/vendor/oro/oauth2-server/src/Oro/Bundle/OAuth2ServerBundle/Resources/views/Client/dialog/update.html.twig");
